function LandingPage()
{
  const n = 15; 
  const items = Array.from({ length: n }, (_, index) => (
    <Item key={index} />
  ));


  fetch("/api/store/products")
  .then(res => console.log(res))

  return (
    <div className="Body">
      <NavBarComponent/>
        <div className="Item-types">
          Trending
        </div>
        <div className="Item-container">{items}</div>
    </div>
  );

}
